script: |
  super -f text -I q7996.spq | sort > q7996.out

inputs:
  - name: q7996.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE + col0 BETWEEN col0 AND + ( col1 ) + + col0 * col1 OR NOT NULL BETWEEN col1 / - CAST ( NULL AS INTEGER ) + 27 AND col0;
  - name: tab1

outputs:
  - name: q7996.out
    data: |
      51	14	96
      85	5	59
      91	47	68
